// to run: npm run start

import React, {Component} from 'react';
import Navabr from './Navbar';
import './App.css';


class App extends Component {

    constructor(props) {
        super(props)
        this.state = {
            account: 'test',
        }
    }
    // our React code 
    render () {
        return (
            <div>
                <Navabr account={this.state.account} />
            </div>
        )
    }
}


export default App
